import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

const NavBar = ({ token, adminId }) => {

    const navigate = useNavigate();


    const handleAds= () => {
        navigate(`/adminViewAllAds?token=${token}&adminId=${adminId}`);
      };
      const handleAdsSlider= () => {
        navigate(`/adminSliderAds?token=${token}&adminId=${adminId}`);
      };
      
    const handleSllers= () => {

      // navigate(`/adminPendingAds?token=${responseData.token}&userId=${responseData.userId}`);

    };

    const handleHome = () => {
      navigate(`/adminDashboard?token=${token}&adminId=${adminId}`);
    }

  return (
    <nav className="navbar navbar-expand-lg ">
      <div className="container-fluid">
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNavDropdown"
          aria-controls="navbarNavDropdown"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"> </span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNavDropdown">
          <ul className="navbar-nav">
          <li className="nav-item hover-zoom">
              <a
                className="nav-link active"
                aria-current="page"
                href="#"
              >
                <button
                  type="button"
                  className="btn btn-warning"
                  onClick={handleHome}
                  > DashBoard

                </button>

              </a>
            </li>
            <li className="nav-item hover-zoom">
              <a
                className="nav-link active"
                aria-current="page"
                href="#"
              >
                <button
                  type="button"
                  className="btn btn-warning"
                  onClick={handleAds}
                  > All Ads

                </button>

              </a>
            </li>
            <li className="nav-item hover-zoom">
              <a
                className="nav-link active"
                aria-current="page"
                href="#"
              >
                <button
                  type="button"
                  className="btn btn-warning"
                  onClick={handleAdsSlider}
                  >  Slider Ads

                </button>

              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="#">
                <button type="button" className="btn btn-warning text-dark text-light text-decoration-none fs-6 font-weight-bold" onClick={handleSllers}>
                    Show Sellers
                </button>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                Pricing
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default NavBar
